generated_sparql:
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX brick: <https://brickschema.org/schema/Brick/>
PREFIX a223: <http://data.ashrae.org/standard223#>
PREFIX a223sb: <http://data.ashrae.org/standard223/si-builder#>

SELECT ?zoneLabel ?propLabel ?endpoint ?mpcName ?alcLabel WHERE {
  # Zones (PhysicalSpace)
  ?zone a a223:PhysicalSpace .
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }

  # Connection points attached to a zone (any type)
  ?zone a223:hasConnectionPoint ?cp .

  # Properties associated with the connection point
  ?cp a223:hasProperty ?prop .
  ?prop rdfs:label ?propLabel .

  # Keep only nonwritable properties (exclude those marked writable true)
  FILTER NOT EXISTS {
    ?prop brick:writable ?w .
    FILTER(?w = "True"^^<http://www.w3.org/2001/XMLSchema#string>)
  }

  # Optional ALC external reference (label contains 'alc')
  OPTIONAL {
    ?prop a223:hasExternalReference ?ext .
    ?ext rdfs:label ?alcLabel .
    FILTER(CONTAINS(LCASE(STR(?alcLabel)), "alc"))
  }

  # Optional MPC endpoint and DB name
  OPTIONAL { ?prop brick:endpoint ?endpoint . }
  OPTIONAL { ?prop brick:mpc_db_name ?mpcName . }
}
ORDER BY ?zoneLabel ?propLabel
